    }
    if(!nombre){
        errors.push({text:'Por favor llena el nombre'});
    }
    if(!carrera){
        errors.push({text:'Por favor llena la carrera'});
    }
    if(!bloque){
        errors.push({text:'Por favor selecciona el bloque'});
    }
    if(!seccion){
        errors.push({text:'Por favor selecciona la seccion'});
